Tales of the Legion of Super-Heroes #325
Publisher:  DC Comics
Publication Date:  July 1985

Writers:  Mindy Newell and Paul Levitz
Penciler:  Dan Jurgens
Inker:  Karl Kesel
Colorist:  Carl Gafford
Letterer:  Gaspar Saladino
Cover:  Dan Jurgens, Karl Kesel, and Anthony Tollin

The Legion of Super-Heroes are able to defeat the threat of the Dark Circle and save the life of Dev-Em in the process.  This is the last new story in Tales of the Legion of Super-Heroes. The story ends with Blok and White Witch watching holo-tapes of recent cases. On the last panel the holo-video screen shows the cover art from Legion of Super-Heroes v3 #1 - this is a segue to the reprints, which begin next issue.

